V telefonu:
&quot;Dobrý den, je Honza doma?&quot;
&quot;Zatím jo, ale věnce už odnesli.&quot;

Cedule v ZOO:
&quot;Prosíme, nelezte na zdi výběhů. Pokud byste spadli a zvířata vás sežrala, mohlo by se jim udělat špatně.
Děkujeme.&quot;

&quot;Izáku, slibuju, že po svatbě s tebou budu ve všech tvých starostech, problémech a protivenstvých.&quot;
&quot;Ale já žádný problémy a starosti nemám.&quot;
'Však říkám, po svatbě...&quot;

Ptá se student rabína: &quot;Rebe, smí se při studiu Talmudu kouřit?&quot;
&quot;Ne, nesmí!&quot;
Student zklamaně odejde, ale kamarád ho utěšuje: &quot;Zeptal ses špatně, to musíš jinak: Rebe, smí se při kouření studovat Talmud?&quot;
&quot;Ano, smí…&quot;

Potkají se dva Židé a jeden se ptá druhého:
&quot;Odkud máš ty fantastické hodinky?&quot;
&quot;Taťka mi je těsně před smrtí prodal.&quot;

&quot;Poslechni Karle, na co umřela Steinova třetí žena?&quot;
&quot;Otrava houbami.&quot;
&quot;A druhá?&quot;
&quot;Taky otrava houbami&quot;
&quot;A první taky otrava houbami?&quot;
&quot;Ne, proražená lebka.&quot;
&quot;To je divné.&quot;
&quot;Ani ne, nechtěla jíst houby.&quot;

Ptá se blondýna kolemjdoucího:&quot;Nevíte náhodou, kolik je hodin?&quot;
&quot;Za deset minut bude jedenáct.&quot;
&quot;Jo, za deset minut, ale kolik hodin je teď?&quot;

&quot;Pane profesore, může student skládat zkoušku, když je opilý?&quot;

&quot;Nooo, v podstatě může…&quot;

&quot;Chlapci, přineste ho!&quot;

Baví se dva malý kluci:
&quot;Jdeš si dneska ven hrát?&quot;
&quot;Ne, musím pomáhat tatínkovi s mým úkolem.&quot;

Učitelka se ptá žáků, co mají doma za zvířátko. Přihlásí se Mařenka a říká: &quot;My máme pejska.&quot;

Přihlásí se Honzík a říká: &quot;My máme kočičku.&quot;

Nakonec se přihlásí Pepíček a říká: &quot;My máme kuře v mrazáku!&quot;

Oznamuje Skot své ženě: &quot;Koupil jsem ti něco na krk, má drahá!&quot;
&quot;Náhrdelník?&quot;
&quot;Ne.&quot;
&quot;Zlatý řetízek?&quot;
&quot;Ne.&quot;
&quot;A co to tedy je?&quot;
&quot;Mýdlo, miláčku!&quot;

Telefonní rozhovor:
&quot;Je tam váš šéf?&quot;
&quot;Ne, odjel na výlet.&quot;
&quot;Za odpočinkem, co?&quot;
&quot;Myslím si, že ne… Vzal sebou svou ženu!&quot;

&quot;Moje žena chce zhubnout, tak jezdí pořád na koni.&quot;
&quot;A pomáhá to?&quot;
&quot;Za první měsíc zhubl kůň deset kilo.&quot;

Povídá muž manželce, která právě položila sluchátko:
&quot;Co se stalo, že jsi mluvila jen čtvrt hodiny?&quot;
&quot;Byl to omyl.&quot;

&quot;Včera mě tak nasrala tchýně, že jsem se neovládl.&quot;
&quot;A co jsi ji udělal?&quot;
&quot;Schoval jsem jí zuby.&quot;

Tchýně přijde navštívit zetě. Ten otevře dveře a vítá ji:
&quot;Dobré odpoledne, maminko. Jsem tak rád, že vás vidím. Je to tak dávno, co jsem vás viděl naposledy. Pojďte dál! Jak dlouho se zdržíte?&quot;
&quot;Dokud tě nebude moje přítomnost unavovat.&quot;
&quot;Vy nechcete zůstat ani na čaj?&quot;

Přiběhne vyděšená žena za svým mužem:
&quot;Pospěš si Franto, do chaty mé matky vešel strašný medvěd!&quot;
&quot;Má drahá, opravdu netuším, jak bych ho mohl před tvou matkou ochránit.&quot;

Přijde pán do obchodu a ptá se: &quot;Máte kostkový cukr?&quot;
&quot;Bohužel, nemáme.&quot;
&quot;A nějakou jinou lacinou bonboniéru pro tchyni?&quot;

Společensky značně unavený muž vstoupí do taxíku a poručí:
&quot;Prosím, k hlavnímu nádraží!&quot;
&quot;Ale vždyť jsme u nádraží, pane!&quot;
Zákazník se nedůvěřivě podívá na taxikáře, dá mu stokorunu a řekne:
&quot;Dobře. Ale podruhé nejezděte tak rychle!&quot;

&quot;Pane vrchní, proč nedoléváte?&quot;

&quot;Protože jsem již starý a špatně vidím.&quot;

&quot;A proč tedy nepřeléváte?&quot;

&quot;No, slepý přece nejsem.&quot;

Devadesatiletá babka si stězuje lékaři:
&quot;Pane doktore, tady mě bolí, tam mě bolí, co mám dělat?&quot;
&quot;Večer si vezměte trochu hlíny a sypejte na sebe.&quot;
&quot;A pomůže to?&quot;
&quot;Ne, ale zvykejte si!&quot;

Přijde Indián na matriku:
&quot;Chtěl bych si změnit jméno!&quot;
&quot;Proč, jak se jmenujete?&quot;
&quot;Velký-vlak-co-dvakrát-zahouká-když-jede-okolo.&quot;
&quot;A jak by jste se chtěl jmenovat?&quot;
&quot;Tutút.&quot;

&quot;Není ta operace nebezpečná, pane doktore,&quot; vyzvídá pacient.
&quot;Je. Z pěti se podaří v průměru jen jedna.&quot;
Pacient se vyděsí, ale lékař se ho snaží uklidnit: &quot;Žádný
strach, mně už se tento týden čtyři nepovedly…&quot;

Chlápek zabil svou tchýni.
Před soudem se obhajuje: &quot;To mi přikázala moje žena!&quot;
&quot;A jak to vlastně bylo?&quot;
&quot;Šla nakupovat do města a řekla mi: Na gauči spí maminka, kdyby na ní sedla moucha, tak ji zab!&quot;

